import React from "react";
import '../css/Skill.css'

const Skills = () => {
    return(
        <div >
            <div className="Skill_box">
                <div className="title-skill">
                    <div className="box-cover-skill">
                        <p className="text-skill">my skills</p>
                    </div>
                </div>
            </div>

        </div>
    );
}
export default Skills;
